package de.florianwip.ktinventory.item

import com.destroystokyo.paper.profile.ProfileProperty
import org.bukkit.Bukkit
import org.bukkit.inventory.ItemStack
import java.util.UUID

/**
 * A enum representing common MHF Skulls
 *
 * @property mhfName The (account) name of the MHF-Skull
 * @property uuid The (account) uuid of the MHF-Skull
 * @property base64 The base64 value of the MHF-Skull
 */
enum class MHFSkull(val mhfName: String, val uuid: String, val base64: String) {
    BLAZE("MHF_Blaze", "4c38ed11-596a-4fd4-ab1d-26f386c1cbac", ""),
    CAVE_SPIDER("MHF_CaveSpider", "cab28771-f0cd-4fe7-b129-02c69eba79a5", ""),
    CHICKEN("MHF_Chicken", "92deafa9-4307-42d9-b003-88601598d6c0", ""),
    COW("MHF_Cow", "f159b274-c22e-4340-b7c1-52abde147713", ""),
    ENDERMAN("MHF_Enderman", "40ffb372-12f6-4678-b3f2-2176bf56dd4b", ""),
    GHAST("MHF_Ghast", "063085a6-797f-4785-be1a-21cd7580f752", ""),
    GOLEM("MHF_Golem", "757f90b2-2344-4b8d-8dac-824232e2cece", ""),
    HEROBRINE("MHF_Herobrine", "9586e5ab-157a-4658-ad80-b07552a9ca63", ""),
    LAVA_SLIME("MHF_LavaSlime", "0972bdd1-4b86-49fb-9ecc-a353f8491a51", ""),
    MUSHROOM_COW("MHF_MushroomCow", "a46817d6-73c5-4f3f-b712-af6b3ff47b96", ""),
    OCELOT("MHF_Ocelot", "1bee9df5-4f71-42a2-bf52-d97970d3fea3", ""),
    PIG("MHF_Pig", "8b57078b-f1bd-45df-83c4-d88d16768fbe", ""),
    PIG_ZOMBIE("MHF_PigZombie", "18a2bb50-334a-4084-9184-2c380251a24b", ""),
    SHEEP("MHF_Sheep", "dfaad551-4e7e-45a1-a6f7-c6fc5ec823ac", ""),
    SLIME("MHF_Slime", "870aba93-40e8-48b3-89c5-32ece00d6630", ""),
    SPIDER("MHF_Spider", "5ad55f34-41b6-4bd2-9c32-18983c635936", ""),
    SQUID("MHF_Squid", "72e64683-e313-4c36-a408-c66b64e94af5", ""),
    VILLAGER("MHF_Villager", "bd482739-767c-45dc-a1f8-c33c40530952", ""),
    WITHER("MHF_Wither", "39af6844-6809-4d2f-8ba4-7e92d087be18", ""),
    CACTUS("MHF_Cactus", "1d9048db-e836-4b9a-a108-55014922f1ae", ""),
    CAKE("MHF_Cake", "afb489c4-9fc8-48a4-98f2-dd7bea414c9a", ""),
    CHEST("MHF_Chest", "73d4e068-3a6d-4c8b-8f85-3323546955c4", ""),
    MELON("MHF_Melon", "1c7d9784-47ea-4bf3-bc23-acf260b436e6", ""),
    OAK_LOG("MHF_OakLog", "e224e5ec-e299-4005-ae22-3b0f77a57714", ""),
    PUMPKIN("MHF_Pumpkin", "f44d355b-b6ae-4ba8-8e62-ae6441854785", ""),
    TNT("MHF_TNT", "d43af93c-c330-4a3d-bab8-ee74234a011a", ""),
    TNT2("MHF_TNT2", "55e73380-a973-4a52-9bb5-1efa5256125c", ""),
    ARROW_UP("MHF_ArrowUp", "fef039ef-e6cd-4987-9c84-26a3e6134277", ""),
    ARROW_DOWN("MHF_ArrowDown", "68f59b9b-5b0b-4b05-a9f2-e1d1405aa348", ""),
    ARROW_LEFT("MHF_ArrowLeft", "a68f0b64-8d14-4000-a95f-4b9ba14f8df9", ""),
    ARROW_RIGHT("MHF_ArrowRight", "50c8510b-5ea0-4d60-be9a-7d542d6cd156", "");

    /**
     * Build an [ItemStack] from a MHF-Skull
     *
     * Note: The base64 value is directly applied. It should not create any api calls
     *
     * @param block the [ItemBuilder]
     * @return A [ItemStack] from a MHF-Skull
     */
    fun buildSkull(block: ItemBuilder.() -> Unit): ItemStack {
        val profile = Bukkit.createProfile(UUID.fromString(this.uuid), this.mhfName)
        profile.setProperty(ProfileProperty("textures", this.base64))
        return buildItem {
            skullProfile = profile
            block()
        }
    }

}